import { useNavigate } from "react-router-dom"
import NotPageImg from "../assets/notfound.png"
import "./404.css";

const Error = ()  =>{
     const navigate = useNavigate();

    function backbtn() {
         navigate('/')
    }
  return (
    <div id="NotPage">
    <section>
        <NotPageImg/>
        <button className="back-btn" onClick={backbtn}>Back</button>
    </section>
    </div>
  );
}

export default Error;
